import React from 'react';
import '../App.css';
import Particles from "react-particles-js";


//Update this into your face params
const particleOpt ={
    "particles": {
      "number": {
          "value": 150
      },
      "size": {
          "value": 2
      }
  },
  "interactivity": {
      "events": {
          "onhover": {
              "enable": true,
              "mode": "repulse"
          }
      }
  }

  }


function About (){
    return(
        <div className="App">
            <h1>Maris-Angelique</h1>
            <h3>Full Stack Web Developer</h3>


            <div className="particles">
                <Particles  
                    params= {particleOpt} 
                />
            </div>  

        </div>


    )
}

export default About;
